using Microsoft.IdentityModel.Tokens;
using Microsoft.IdentityModel.Xml;
using System;
using System.Security.Cryptography.X509Certificates;

namespace Abc.IdentityModel.Xml.UnitTests {
    public class EncryptedDataTestSet : XmlTestSet {
        public EncryptedData EncryptedData { get; set; }

        public static EncryptedDataTestSet EncryptedDataFullyPopulated {
            get {
                var data = new X509Data(new X509Certificate2(Convert.FromBase64String("")));
                var keyInfo = new KeyInfo();
                keyInfo.X509Data.Add(data);

                var encryptedKey = new EncryptedKey() {
                    EncryptionMethod = new EncryptionMethod(new Uri("http://www.w3.org/2001/04/xmlenc#rsa-oaep-mgf1p")),
                    KeyInfo = keyInfo,
                    CipherData = new CipherData(Convert.FromBase64String(""))
                };

                var encryptedData = new EncryptedData {
                    Type = XmlEncryptionConstants.EncryptedDataTypes.Element,
                    EncryptionMethod = new EncryptionMethod(new Uri(SecurityAlgorithms.Aes256Encryption)),
                    KeyInfo = new EncryptedKeyKeyInfo(encryptedKey),
                    CipherData = new CipherData(Convert.FromBase64String("")),
                };

                return new EncryptedDataTestSet {
                    EncryptedData = encryptedData,
                    TestId = nameof(EncryptedDataFullyPopulated),
                    Xml = @"<xenc:EncryptedData Type=""http://www.w3.org/2001/04/xmlenc#Element"" xmlns:xenc=""http://www.w3.org/2001/04/xmlenc#"">
                                <xenc:EncryptionMethod Algorithm=""http://www.w3.org/2001/04/xmlenc#aes256-cbc"">
                                    <ds:DigestMethod Algorithm=""http://www.w3.org/2000/09/xmldsig#sha1"" xmlns:ds=""http://www.w3.org/2000/09/xmldsig#""/>
                                </xenc:EncryptionMethod>
                                <KeyInfo xmlns=""http://www.w3.org/2000/09/xmldsig#"">
                                    <xenc:EncryptedKey>
                                        <xenc:EncryptionMethod Algorithm=""http://www.w3.org/2001/04/xmlenc#rsa-oaep-mgf1p"">
                                            <ds:DigestMethod Algorithm=""http://www.w3.org/2000/09/xmldsig#sha1"" xmlns:ds=""http://www.w3.org/2000/09/xmldsig#""/>
                                        </xenc:EncryptionMethod>
                                        <KeyInfo>
                                            <X509Data>
                                                <X509Certificate></X509Certificate>
                                            </X509Data>
                                        </KeyInfo>
                                        <xenc:CipherData>
                                            <xenc:CipherValue></xenc:CipherValue>
                                        </xenc:CipherData>
                                    </xenc:EncryptedKey>
                                </KeyInfo>
                                <xenc:CipherData>
                                    <xenc:CipherValue></xenc:CipherValue>
                                </xenc:CipherData>
                            </xenc:EncryptedData>"
                };
            }
        }
    }
}
